INSERT INTO `question` VALUES (1,1,'D','R',1,1,'This article is mostly about a boy who','main idea','Robbie wanted to figure out a way to use the nubbies. Robbie thought about a holder that would work like a push-up pop does. Robbie\'s Crayon Saver won a blue ribbon at his school invention fair. Mrs. Andrews gave Robbie a mock patent for the Crayon Saver.',NULL,1),(2,1,'H','R',1,1,'Robbie solved the problem of how to make a crayon holder work when he noticed that','locate information','The straw from a sports bottle is a little wider than a paper straw. Since it\'s made from plastic, it\'s stronger, too. A plastic crayon holder would last a long time.',NULL,2),(3,1,'C','R',1,1,'Which sentence from the article best shows that Robbie is curious?','inference','Robbie wanted to figure out a way to use the nubbies. They just needed some sort of holder that would make them longer.',NULL,3),(4,1,'G','R',1,3,'The author most likely wrote this article to','author\'s purpose','Not only had he found a way to keep from wasting crayons, he\'d designed something that a lot of kids would like to use.',NULL,4),(5,2,'D','R',1,2,'The passage is mostly about','main idea','Let me help you, said her brother, Abdul. He picked the knot apart and quickly tied a bow on her shoe. Abdul got off the bus just behind her. Don\'t worry, he said, if we take them home and dry them immediately, they will be all right.what you like best about one of your friends. The best thing about my brother Abdul',NULL,5),(6,2,'F','R',1,2,'What did Maya\'s teacher write at the top of the page?','locate information','The teacher had written at the top of the page. Write a short composition explaining what you like best about one of your friends',NULL,6),(7,2,'B','R',1,2,'Why does Maya smile when she looks at the writing assignment?','inference','when she looked at the extra writing assignment, she smiled. started to write, the best thing about my brother',NULL,7),(8,2,'H','R',1,3,'Which of these details is most important to what happens in the passage?','inference','She had been in such a hurry that she forgot to bring her homework and the teacher was not happy about that. The teacher gave her an extra writing assignment to do for the next day. But when she looked at the extra writing assignment, she smiled. The teacher had written at the top of the page: Write a short composition explaining what you like best about one of your friends.',NULL,8),(9,2,'A','R',1,2,'In the passage, the most important lesson Maya learns is','inference','Write a short composition explaining what you like best about one of your friends. Maya started to write, The best thing about my brother Abdul',NULL,9),(10,2,'G','R',1,2,'This passage is most like a','inference','a brother, a teacher and a mother, assignments',NULL,10),(11,3,'B','R',1,1,'What is this article mostly about?','main idea','how animals stay safe. There are many ways animals keep safe from their predators.',NULL,11),(12,3,'J','R',1,1,'Which fact would be best to include in a report about chameleons?','locate information','A chameleon is an animal that can change its color to hide.',NULL,12),(13,3,'C','R',1,1,'Which fact from the article best supports the idea that a red frog might be poisonous?','inference','animals and insects that use poison have very bright colors',NULL,13),(14,3,'G','R',1,1,'Here is a web about the article. porcupine, lobster, hermit crab, animals that have a shield, which animal could be added to this web?','locate information','oysers hide in hard shells',NULL,14),(15,3,'A','R',1,1,'According to the article, which statement about hermit crabs is true?','locate information','One animal, the hermit crab, does not grow its own shell, but finds shells that have been outgrown or left by other animals. Hermit crabs find an empty sea shell and move in.',NULL,15),(16,3,'J','R',1,1,'After reading the article the reader could conclude that','draw conclusion','There are many ways animals keep safe from their predators.',NULL,16),(17,3,'C','R',1,3,'The author most likely wrote this article to','author\'s purpose','nature has given their prey different ways to hide or fight back. Most animals, even very small ones, are not totally helpless.',NULL,17),(18,4,'G','R',1,2,'How does Abby get the idea for her experiment?','interpretation','One night, Abby wondered what it would be like if she only asked questions',NULL,18),(19,4,'A','R',1,2,'Abby first tries the experiment on her','sequence','she asked when her dad told her to get up',NULL,19),(20,4,'H','R',1,2,'According to Abby, what is the trickiest part of the experiment?','locate information','and this was the tricky part--didn\'t sound rude',NULL,20),(21,4,'D','R',1,1,'Read this sentence from the story. This was starting to feel like quicksand. According to this sentence, Abby thinks that she','context clues','how can I get myself out of this',NULL,21),(22,4,'F','R',1,2,'Abby\'s father thinks her experiment is successful because she','interpretation','I think it worked perfectly, her father said. You made a discovery, didnt you?',NULL,22),(23,4,'C','R',1,2,'How would Abby most likely describe scientists?','inference','Abby knew that scientists always started research with a question',NULL,23),(24,5,'G','R',1,1,'What is the first part of the article \"Finding Your Way\" mostly about?','main idea','For hundreds of years, people have used a compass to know the directions. people in China using compasses almost 1000 years ago. Columbus sailed to Americas used compasses',NULL,24),(25,5,'D','R',1,3,'Why does the author most likely include the information about China?','inference','people in China were using compasses almost 1,000 years ago',NULL,25),(26,5,'F','R',1,1,'In which step of \"Make Your Own Compass\" do you use a pen or pencil?','locate information','Write the letter N (north) on one side of the paper cup. Write S (south) directly opposite.',NULL,26),(27,5,'C','R',1,1,'Which item do you use in Step 3?','locate information','Rub the sewing needle across the magnet',NULL,27),(28,5,'H','R',1,1,'What should you do right after wetting the sponge?','locate information','Wet the sponge or cork. Then slide the magnetized needle through it',NULL,28),(29,6,'C','R',1,2,'Which event happens first in the story?','sequence','Just as Addy reached for one of the shells, it began to walk.',NULL,1),(30,6,'D','R',1,2,'Why does the cicada in the story leave its shell behind?','locate information','When it grew bigger, it left its shell behind',NULL,2),(31,6,'B','R',1,2,'Which word best describes Addy?','inference','\"Look, Daddy!\" exclaimed Addy. \"Something is happening to the wings.\"',NULL,3),(32,6,'D','R',1,2,'What would most likely happen next in the story?','make prediction','\"When Addy woke the next morning, she ran outside to the tree to check her cicada\"',NULL,4),(33,6,'A','R',1,2,'Read this sentence from the story. The crack got wider and wider, until Addy could see the insect\'s back emerging. The word \"Emerging\" most likely means','context clues','crack got wider and wider',NULL,5),(34,7,'D','R',1,1,'According to the article, how are koalas and kangaroos alike?','locate information','This means the mother carries her baby in a pouch while it develops, similar to a kangaroo.',NULL,6),(35,7,'A','R',1,1,'According to the article, the word \"koala\" comes from a word that means','locate information','The name koala comes from an aboriginal word that means no drink',NULL,7),(36,7,'B','R',1,1,'Read this sentence from the article. Koalas\' strong limbs and big hands help them climb trees. In this sentence, the word \"limbs\" most likely means','context clues','and big hands help climb trees',NULL,8),(37,7,'B','R',1,1,'According to the article, why do koalas sleep a lot?','interpretation','Koalas eat only eucalyptus leaves. They sleep so much because there isnt much nutrition in eucalyptus leaves. Koalas store hardly any fat, so they must conserve their energy',NULL,9),(38,7,'D','R',1,1,'Read these sentences from the article. Koalas are very protective of their trees. If a koala sees another koala eating in its favorite tree, it might tell the other koala to leave by \"barking\" at it. The first sentence means that koalas','context clues','it might tell the other koala to leave by \"barking\" at it.',NULL,10),(39,7,'C','R',1,1,'if an adult koala becomes upset, it will most likely make a sound like','locate information','If they get upset or scared they may scream like a baby',NULL,11),(40,7,'C','R',1,3,'Read this sentence from the article. Koalas do \"talk\" to each other. In this sentence, why does the author include quotation marks around \"talk\"?','inference','Besides barks, the males make a deep grunting sound. The mothers and babies talk in soft clicking sounds. They also make humming or murmuring sounds. If they get upset or scared they may scream like a baby.',NULL,12),(41,8,'B','R',1,2,'Which word best describes Han Han?','inference','For months you\'ve watered the wildflower seeds. Your failure has changed our village and made it more beautiful',NULL,13),(42,8,'C','R',1,2,'The chart below shows the order of events in the story. han han fills the jugs with water. the cracked jug leaks water onto the path. ?. Han han shows the jug to the flowers. Which event best completes the chart?','sequence','I am a failure, it cried. Why do I have a crack?',NULL,14),(43,8,'B','R',1,2,'What will most likely happen next in the story?','make prediction','Then all that time I felt useless, said the cracked jug, my flaw was really my most valuable part',NULL,15),(44,8,'D','R',1,3,'Which detail about the jugs is most important to the story?','inference','What did you think of the flowers? asked Han Han. They\'re pretty, replied the jug. They\'re only growing on my side of the path',NULL,16),(45,8,'D','R',1,2,'Read this sentence from the story. \"Then all that time I felt useless,\" said the cracked jug, \"my flaw was really my most valuable part!\" Which word means about th